import React from 'react';
import ButtonsBottom from '../components/ButtonsBottom';
import Logo from '../components/Logo';
import Navigation from '../components/Navigation';
//A FAIRE
const Presentation = () => {

    let left = Math.floor(Math.random() * 200 + 700) + "px";
    let top = Math.floor(Math.random() * 200 + 150) + "px";
    let transform = "scale(" + (Math.random() + 0.7) + ")";


    return (
        <main>
            <div className="widget">
                <Navigation />
                <Logo/>
                <h1 className="titre">Présentation du Bureau</h1>
                <div className="row">
                    <div className="column">
                        <img className="image" src="/assets/presentation/PP-CorentinR.png" alt="photo1" width="189" height="226"></img>
                    </div>
                    <div className="column">
                        <img className="image" src="/assets/presentation/PP-ArnaudM.png" alt="photo2" width="189" height="226"></img>
                    </div>
                    <div className="column">
                        <img className="image" src="/assets/presentation/PP-MatthieuB.png" alt="photo3" width="189" height="226"></img>
                    </div>
                    <div className="column">
                        <img className="image" src="/assets/presentation/PP-CamilleV.png" alt="photo4" width="189" height="226"></img>
                    </div>
                    <div className="column">
                        <img className="image" src="/assets/presentation/PP-AntoineC.png" alt="photo5" width="189" height="226"></img>
                    </div>
                    <div className="column">
                        <img className="image" src="/assets/presentation/PP-AntoineG.png" alt="photo6" width="189" height="226"></img>
                    </div>
                    <div className="column">
                        <img className="image" src="/assets/presentation/PP-RichardL.png" alt="photo7" width="189" height="226"></img>
                    </div>
                    <div className="column">
                        <img className="image" src="/assets/presentation/PP-PaulP.png" alt="photo8" width="189" height="226"></img>
                    </div>
                </div>
                <div>
                    <span className="random-circle" style={{left, top, transform}}></span>
                </div>
                <ButtonsBottom left={'/'} right={'/membres'} />
            </div>
        </main>
    );
};

export default Presentation;
